import React from 'react';
import { Link } from 'react-router-dom';

function Navbar({ role }) {
  return (
    <nav>
      <div className="logo">Edu Sphere</div>
      <input type="checkbox" id="click" />
      <label htmlFor="click" className="menu-btn">
        <i className="fas fa-bars"></i>
      </label>
      <ul>
        {/* Common links */}
        <li><Link to="/Home">Home</Link></li>

        {/* Role-specific links */}
        {role === 'faculty' && (
          <>
            <li><Link to="/Marks">Marks</Link></li>
            {/* Add more links for faculty as needed */}
          </>
        )}
        {role === 'student' && (
          <>
            <li><Link to="/Stumarks">Student Marks</Link></li>
            {/* Add more links for students as needed */}
          </>
        )}
        {role === 'management' && (
          <>
            <li><Link to="/Gallery">Gallery</Link></li>
            {/* Add more links for management as needed */}
          </>
        )}
        {role === 'non-technical' && (
          <>
            <li><Link to="/About">About</Link></li>
            {/* Add more links for non-technical as needed */}
          </>
        )}

        {/* Common links */}
        <li><Link to="/Login">Login</Link></li>
        <li><Link to="/Reg">Register</Link></li>
      </ul>
    </nav>
  );
}

export default Navbar;
